content:
&lt;Me opens Twitter&gt;
Oh, yeah, it's April 1.
&lt;/Me closes Twitter&gt;

@DanielMiessler I have a cabinet full of scotch and other liquors, but, like you, I rarely drink anymore.

I still drink socially, but given family histories and the like, I don't want drinking at home to become habitual or worse.  

Limit imbibing dangerous poisons to when you're with friends!

@ErrataRob You missed CDNs.

None, in my opinion, but I'm in the minority.

'Censoring' by carries a lot of negative connotations that I don't feel like addressing today.

@krypt3ia Let me be clear!

I am NOT inviting you to provide that swift kick.

Kthxbye

@jowyang @hsinjuchuang @RLYNetworkAssoc Gotcha,

"Hack" in the "cludging things together well enough to present a demo" sense.

Not the "making furniture", "Golf", or "breaking computers" definitions.

@AlyssaM_InfoSec "Level Setting"

or 

"Reminding the sales person what they're supposed to be talking about."

@marcusjcarey Good to know.  

Whistleblowers are rare in general and I've never heard of another CSO acting similarly.  

Lower level employees leaking documents and information about breaches, but not a CSO.

@mediaphyter The original quest was 'Why?', which got answered relatively quickly.  

I still thing of the magazine that made me ask the question as one that gave awards to companies and products, so I was honestly curious.  

I realize now that came across as an eye roll.

@cyentiainst @ISMGCorp So much blue!

No, seriously, too many shades of blue make these plots unreadable.  

Try using a palette that includes something with more contrast than 'cyan vs cobalt' next time

@diami03 I'm hosting a game tomorrow night at my house.  It's the first time I've been able to host in a decade, and it's been a several years since I've GM. 

Honestly, I'm a little nervous.

(Also, no, I won't become your Sugar Person.  But you can come to visit.)

@rik_ferguson Wait, what?  You've been there FOREVER!  

Then again, getting too comfortable is a a good reason to leave.  Expand your horizons, learn something new, start a grand new adventure!

Looking forward to hearing the good news!

@imaguid I found out when we took my youngest to a specialist in England.

"I can already tell your son is ADHD, and I see exactly where he gets it from."

True story.

@m1a1vet When I started the podcast, my wife asked me, "Why do you want to do this?"

I couldn't tell her why, I just knew it was going to be something interesting and I needed to do it.

I'm glad to have had an impact on your success, and through you many more.

@Walshman23 I think his words were, "Your son is definitely ADHD and I can see where he gets it from."

Me: "What?"

Him: "You didn't realize you had ADHD?"

@kriggins "I mostly quit spending non-work time on work stuff some time ago."

So much this, @kriggins !!

We all need more time to recharge than we allow ourselves.

@lil_lost In my drawers. 

Wait, that doesn't sound right.

Try Amazon.

@hrbrmstr Why would you badmouth librarians like that ...

rereads the text

Oh, nvmnd.

@bamchenry @orysegal Also, "let's rely on the WAF to solve everything" leaves me giggling.  That hasn't been a reasonable solution in decades.  

Layered security controls always make sense.

Sorry if that's not the way you meant it to be taken, it is the way I read it.

@snipeyhead I can imagine you having an error message in that literally states, 

"Do'h!  If you're reading this, you dun fskced up!"

(If you don't, please add one.)

@diami03 I agree to all your points, and thank you for responding. 

I want us thinking about to road to recovery for the individual, even as we continue to condemn the actions that led to the individual being banned.  

Forgiveness is really hard.

"My toe hurts.  I wonder if I have an ingrown nail?"
&lt;touch&gt;&lt;spurt&gt;
"So, that's a yes."

@toroonthemove @krypt3ia I will use double spacing until the day I die!

I will also use Find and Replace to replace the double space with a single space because that's what people expect in a publication.

People who don't use the Oxford comma are just evil.

@krypt3ia "I'm sorry sir, but each incarnation only get's one chance.  In order to restart, you need to start at the beginning."
"You mean my birth?  The birth of civilization?  The Big Bang?"
"Definitely not that last one.  Just 1000 BC, when the world was created."

@krypt3ia *Movie guy voiceover*

WHAT IF, YOU LIVED IN A WORLD WHERE THE SENATORS ARE WILLING PUPPETS FOR THE DISINFORMATION NETWORKS WHO CLAIM TO BE NEWS SOURCES BUT REALLY RUN EVERYTHING....

*This is no movie, this is our reality now.**
